	add("skeleton", "{\"term\":\"skeleton\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027σκελετός\u0027 (dried up, withered, dried body, parched, mummy) from \u0027σκελλώ\u0027 (dry, dry up, make dry, parch) from Proto-indo-european {{m|ine-pro|*(s)kelh₁-||to parch, wither}}; compare Greek Σκληρός \u0026quot;hard\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The system that provides support to an organism, internal and made up of bones and cartilage in vertebrates, external in some other animals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1883\u0027\u0027, w:Robert Louis Robert Louis Stevenson, \u0027w:Treasure Treasure Island\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At the foot of a pretty big pine, and involved in a green creeper, which had even partly lifted some of the smaller bones, a human \u0027\u0027skeleton\u0027\u0027 lay, with a few shreds of clothing, on the ground\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A frame that provides support to a building or other construction\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A very thin person\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"She lost so much weight while she was ill that she became a skeleton\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"From the sled used, which originally was a bare frame, like a skeleton.) A type of tobogganing in which competitors lie face down, and descend head first (compare luge). See Wikipedia:Skeleton (sport\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A client-helper procedure that communicates with a stub\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"RMI Nomenclature: in RMI, the client helper is a \u0027stub\u0027 and the service helper is a \u0027skeleton\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The vertices and edges of a polyhedron, taken collectively\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An anthropomorphic representation of a skeleton. See Wikipedia:Skeleton (undead\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"She dressed up as a \u0027\u0027skeleton\u0027\u0027 for Halloween\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The central core of something that gives shape to the entire structure\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027skeleton\u0027\u0027 of the organisation is essentially the same as it was ten years ago, but many new faces have come and gone\", \"priority\":14}]}, \"synonyms\":{\"list\":[{\"text\":\"ottomy\", \"synonymQualifier\":\"OBSOLETE\"}]}}");

